import './i'

const Navbar = () => {
    const logo = "./images/logo.svg";
    return (
        <nav>
            <img src={logo} alt="logo"/>
            <img src="./images/icons8-menu.svg" alt="navbar"/>
        </nav>
    );
}

export default Navbar;
